import React from "react";
import {
  BrowserRouter,
  Switch,
  Route
} from "react-router-dom";
import MainPage from '../pages/MainPage.js'

const Router = () => (
  <BrowserRouter>
    <Switch>
      <Route path='' component={MainPage}>
      </Route>
    </Switch>
  </BrowserRouter>
);

export default Router;
